import{_ as e}from"./plugin-vue_export-helper-c27b6911.js";import{o as p,c as i,f as t}from"./app-320b8f01.js";const n="/WynncraftCNguide/assets/img/lvl90-1.jpg",o="/WynncraftCNguide/assets/img/lvl90-3.jpg",c={},d=t('<h1 id="fantastic-voyage-level-90" tabindex="-1"><a class="header-anchor" href="#fantastic-voyage-level-90" aria-hidden="true">#</a> Fantastic Voyage (Level 90)</h1><p><strong>奇妙的航行</strong></p><p>1.跟<em>Relend</em>对话 <code>[1304,35,-4043]</code></p><p>2.找到鹦鹉</p><div class="hint-container tip"><p class="hint-container-title">提示</p><p>先和Jofash Resident对话，选标蓝的选项</p><figure><img src="'+n+'" alt="你可以很轻松的找到他，他会在附近晃悠" tabindex="0" loading="lazy"><figcaption>你可以很轻松的找到他，他会在附近晃悠</figcaption></figure><p>然后和酒吧老板<code>[1333 39 -4071]</code>对话，他会告诉你鹦鹉在左边的露台，出去就看到了</p><p>接着出来瞎晃悠一下，就会触发Jofash Resident的走路剧情，他会把你带到椰树下让你看到鹦鹉<code>[1301 36 -4121]</code></p><figure><img src="'+o+'" alt="" tabindex="0" loading="lazy"><figcaption></figcaption></figure><p>爬上树右键鹦鹉就能拿到地图了</p></div><p>3.回去<em>Relend</em>那里准备航行，然后上船！</p><p>4.在船上和跟船长Relend对话</p><p>5.找到三个材料</p><div class="hint-container tip"><p class="hint-container-title">提示</p><p><code>Wooden Board</code>位于最顶层的船帆上<code>[2640 78 -4130]</code></p><p><code>Center Piece</code>位于底层甲板尾部</p><p><code>String</code>就在一楼，很好找</p></div><p>6.用工作台做出个<code>Steering Wheel</code></p><p>7.装上方向盘，一颗赛艇，开船，别撞上障碍物就行！</p><p>8.船撞毁了，去底层夹板</p><div class="hint-container tip"><p class="hint-container-title">提示</p><p>你可以通过原先一楼的房间，然后会触发地板塌陷，下到底层甲板处</p></div><p>9.(经过七绕八绕)找到加农炮弹，塞大炮里开一炮，救出Relend</p><p>10.随便往出口放个技能，离开</p><p>11.跟Relend对话</p><p>12.收集Relend要的所有材料，然后在<code>Cooking Pot</code>里面烹饪</p><div class="hint-container tip"><p class="hint-container-title">提示</p><p><code>Coconut</code>在最开始旁边的椰子树就会掉落</p><p><code>7 Berries</code>可以在岛的任意地方打到，推荐沿路走</p><p><code>10 Raw Mutton</code>可以在岛上刷新的Sheep打到</p><p><code>5 Edible Mushrooms</code>可以在<code>[19954 24 -4499]</code>处的洞穴打到(棕色蘑菇)</p></div><p>13.把<code>Odd Stew</code>拿给Relend</p><p>14.调查一下岛屿东边的蓝色帐篷</p><p>15.回去没有被毒死的<em>Relend</em>那里</p><p>16.调查奇怪的巨石(要和那个发光的东西聊一下)</p><p>17.回去Relend那里</p><p>18.再次收集Relend要的所有材料，然后在<code>Crafting Table</code>处合成炸药</p><div class="hint-container tip"><p class="hint-container-title">提示</p><p><code>5 Gritty Sand</code>位于岛屿北边的沙滩上，你可以经过蜘蛛洞找到</p><p><code>3 Saw Dust</code>位于岛屿上方的大树下<code>[19964 78 -4587]</code></p><p><code>1 Black Powder</code>可以前往火山顶触发火山喷发剧情，你被炸下来的时候就会获得了</p></div><p>19.在巨石前放置炸药(按下按钮)</p><p>20.进入洞穴最深处</p><p>21.带领Relend，继续探索洞窟</p><p>22.进去神秘的传送门</p><p>23.在这块很像se的地方找到Relend，然后触发剧情</p><div class="hint-container tip"><p class="hint-container-title">提示</p><p>他在往东南角飙车，一直往东南角跑<code>[-23456 4 -9652]</code>就行了</p></div><p>奖励</p><ul><li>3100000 经验</li><li>6144 绿宝石</li><li>Pendant of Prosperity(项链)</li></ul><div class="hint-container tip"><p class="hint-container-title">提示</p><p>出来后，你会发现你来到了Wynn的Abandon Mine...</p></div>',34),a=[d];function l(s,r){return p(),i("div",null,a)}const f=e(c,[["render",l],["__file","level 90 - Fantastic Voyage.html.vue"]]);export{f as default};
